import React from 'react';

import EditIcon from '@material-ui/icons/Edit';
import DeleteIcon from '@material-ui/icons/Delete';

import { makeStyles } from '@material-ui/core/styles';

import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';


const PesquisarFuncionario = () => {
    if(document.querySelector("[name='txtNomeFuncionario']").value == ""){
        alert("Nome deve ser preenchido");
    }
    
}

const useStyles = makeStyles((theme) => ({
    root: {
      display: 'flex',
      flexWrap: 'wrap',
    },
    margin: {
      margin: theme.spacing(1),
    },
    withoutLabel: {
      marginTop: theme.spacing(3),
    },
    textField: {
      width: '25ch',
    },
    table:{
        minWidth:700,
    },
}));

function createData(id, nomeAssociado, area, telefone) {
    return { id, nomeAssociado, area, telefone };
}

const rows = [
    createData(1,'Felipe','11','973400876'),
    createData(2,'Luis','11','993354686'),
    createData(3,'Guilherme','12','997254786'),
    createData(4,'Leonardo','13','988150807'),
    createData(5,'Carlos','13','996335449'),
]

export default function PesquisarDados(){
    const classes = useStyles();

    return(
        <div>
            <TableContainer component={Paper}>
                <Table className={classes.table}>
                    <TableHead>
                        <TableRow style={{backgroundColor:"blue",fontcolor:"white"}}>
                            <TableCell>Id</TableCell>
                            <TableCell align="center">Nome do Associado</TableCell>
                            <TableCell align="center">Área</TableCell>
                            <TableCell align="center">Telefone</TableCell>
                            <TableCell align="center">Editar Associado</TableCell>
                            <TableCell align="center">Editar Medidas</TableCell>
                            <TableCell align="center">Editar Mapeamento</TableCell>
                            <TableCell align="center">Excluir Associado</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {rows.map((row) => (
                            <TableRow key={row.id}>
                                <TableCell component="th" scope="row">
                                    {row.id}
                                </TableCell>
                                <TableCell>{row.nomeAssociado}</TableCell>
                                <TableCell>{row.area}</TableCell>
                                <TableCell>{row.telefone}</TableCell>
                                <TableCell align="center"><EditIcon /></TableCell>
                                <TableCell align="center"><EditIcon /></TableCell>
                                <TableCell align="center"><EditIcon /></TableCell>
                                <TableCell align="center"><DeleteIcon /></TableCell>
                            </TableRow>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>
        </div>
    )
}
